import React from "react";
import { Button, Nav, Navbar, Image } from "react-bootstrap";
import { Link } from "react-router-dom";

const Header = () => {
  return (
    <>
      <Navbar bg='dark' variant='dark' className="navbar">
        <Navbar.Item href='/'>
          <Image src="../../images/logo-app.svg"/> 
        </Navbar.Item>
        <Nav>
          <Nav.Item as={Link} className="nav-link" to="/">
            Início
          </Nav.Item>
          <Nav.Item as={Link} className="nav-link" to="/ocorrencias">
            Ocorrências
          </Nav.Item>
          <Nav.Item as={Link} className="nav-link" to="/ocorrencias_cadastro">
            Cadastrar
          </Nav.Item>
          <Nav.Item as={Link} className="nav-link" to="/dashboard">
            Dashboard
          </Nav.Item>
        </Nav>
      </Navbar>
    </>
  );
};

export default Header;
